import React from 'react';

export default function Main() {
  return (
    <>
    <div className='container' style={{display:"flex",justifyContent:"center",alignItems:"center"}}>
        <div style={{height:"100px",border:"4px solid #EAEAEA",borderRadius:"50%",marginTop:"100px"}}><img src="camera.jpg" alt="error" height="300px" width="250px" ></img></div>
    </div>
    </>
  )
}
